interface props {
    id: number;
    text: string;
    date: string;
}

const Item: React.FC<props> = ({
    id,
    text,
    date
  }) => {
    return (
    <div key={id}>
        <h2>{text}</h2>
        <p>{date}</p>
    </div>
  )
}

export default Item
